ศูนย์เรื่องราวร้องทุกข์ ได้รับการประสานผ่านระบบการจัดการเรื่องราวร้องทุกข์ สำนักงานปลัดสำนักนายกรัฐมนตรี ทำเนียบรัฐบาล รหัสเรื่อง นร02660020000
//อ้างอิงเลขที่รับแจ้ง traffy fondue ( 6XLRL4)
ขอให้ตรวจสอบและแก้ไขปัญหาการต่อเติมหลังคาเมทัลชีทไม่ถูกต้องตามกฎหมาย บริเวณบ้านเลขที่ 321 ซอยลาดพร้าว 130 แขวงคลองจั่น เขตบางกะปิ กรุงเทพมหานคร จุดสังเกตห่างจากท่าเรือวัดกลางประมาณ 500-600 เมตร และหากเดินทางจากซอยลาดพร้าว 130 ตรงเข้าไปประมาณกว่า 1 กิโลเมตร จะพบกับบ้านหลังดังกล่าวทางด้านซ้ายมือ ลักษณะเป็นบ้านปูน ชั้นเดียว โดยมีเจ้าของบ้านเป็นสามี-ภรรยา โดยสามีเพศชาย(ไม่ทราบชื่อ แต่ทราบนามสกุล) อายุประมาณ 60 ปี ส่วนสูงประมาณ 170 เซนติเมตร รูปร่างผอม ผิวสีแทน ส่วนภรรยาเพศหญิง (ทราบชื่อเล่น และทราบนามสกุล) อายุประมาณ 60 ปี ส่วนสูงประมาณ 160 เซนติเมตร รูปร่างอ้วน ผิวสีแทน โดยผู้ร้องแจ้งว่า เมื่อประมาณกลางเดือนมิถุนายน 2565 (ไม่ทราบวันและเวลาที่ชัดเจน) บ้านหลังดังกล่าวมีการต่อเติมหลังคาเมทัลชีทบริเวณด้านหน้าบ้านซึ่งเป็นทรงเพิงหมาแหงน ยกระดับหลังคาสูงขึ้นไปประมาณ 1 เมตร เทียบเท่ากับพื้นชั้น 2 ของบ้านผู้ร้อง (ระบุตามผู้ร้องแจ้ง) และระยะยื่นของชายคาห่างจากบ้านของผู้ร้อง เป็นระยะน้อยกว่า 1 ฟุต (ระบุตามผู้ร้องแจ้ง) ซึ่งชิดกับระเบียงห้องนอนของผู้ร้อง นั้น
//ปัจจุบันเมื่อวันที่ 15 พฤษภาคม 2566 ระยะเวลาล่วงเลยมาห้วงเวลาหนึ่งแล้ว ยังคงได้รับความเดือดร้อนเช่นเดิม เจ้าของอาคารมิได้ดำเนินการแก้ไขปรับปรุงแต่อย่างใด อีกทั้งผู้ร้องยังไม่พบเห็นว่ามีเจ้าหน้าที่จากส่วนงานที่เกี่ยวข้องเข้ามาดำเนินการตรวจสอบ ผู้ร้องร้องขอให้ลงพื้นที่ตรวจสอบเพื่อรับทราบข้อเท็จจริงเกี่ยวกับปัญหาแสงที่กระทบระยะห่างจากที่พักผู้ร้องเพียง 2 เมตรเท่านั้น ผู้ร้องได้รับผลกระทบอย่างมาก อาการดวงตาของผู้ร้องแย่มากกว่าเดิม อยู่ในความดูแลของแพทย์อย่างต่อเนื่อง โดยมีตาแฉะตลอดเวลา เหมือนมีเมือกอยู่ในตาตลอดเวลา บางครั้งตาแดงและตามัว มีนัดพบแพทย์อีกครั้งวันที่ 22 พฤษภาคม 2566 จึงประสงค์ให้หน่วยงานที่เกี่ยวข้องลงพื้นที่ตรวจสอบต่อไป ประกอบกับขอให้มีการตอบกลับในประเด็นการต่อเติมหลังคาเมทัลชีทไม่ถูกต้องตามกฎหมายด้วย (ผู้ร้องยินดีให้เปิดเผยชื่อ-นามสกุล และหมายเลขโทรศัพท์)
//หมายเหตุ ปักหมุดที่สำนักงานเขตเพราะไม่สามารถปักละติจูด ลองติจูดที่ชัดเจนได้ กรุณาอ่านรายละเอียดสถานที่จากรายละเอียดการแจ้งเป็นหลัก
//ศูนย์ฯ ประสานมาเพื่อตรวจสอบและดำเนินการและโปรดพิจารณาให้ความคุ้มครองผู้ร้องและผู้เกี่ยวข้องอย่าให้ต้องรับภัยหรือความไม่ชอบธรรมอันเนื่องมาจากการร้องเรียนการเป็นพยาน หรือการให้ข้อมูลนั้น #ศรท #ศรท1111
#1555 #citydata

ศูนย์เรื่องราวร้องทุกข์ ได้รับการประสานผ่านระบบการจัดการเรื่องราวร้องทุกข์ สำนักงานปลัดสำนักนายกรัฐมนตรี ทำเนียบรัฐบาล รหัสเรื่อง นร02660019885
ขอให้พิจารณายกเลิกการให้บริการของศูนย์บริการการแพทย์ฉุกเฉินกรุงเทพมหานคร (ศูนย์เอราวัณ) หมายเลขสายด่วน 1646 เนื่องจากผู้ร้องซึ่งเป็นผู้พิการทางด้านขาและหลัง (กระดูกหลังหัก ) มีอาการปวดหลังอยู่แล้ว ใช้สิทธิการรักษาพยาบาลเป็นสิทธิหลักประกันสุขภาพแห่งชาติ (สิทธิบัตรทอง) ที่โรงพยาบาลราชพิพัฒน์ เขตบางแค กรุงเทพมหานคร ในวันที่ 13 พฤษภาคม 2566 ผู้ร้องมีอาการอาเจียนหนัก ได้ยืมเงินเพื่อนบ้านจำนวนเงิน 100 บาท (หนึ่งร้อยบาทถ้วน) เพื่อจะเดินทางโดยรถโดยสารประจำทางไปยังโรงพยาบาลราชพิพัฒน์ ซึ่งผู้ร้องยืนรอรถโดยสารประจำทางอยู่ที่ป้ายหยุดรถโดยสารประจำทางก่อนถึงซอยเพชรเกษม 51 เขตบางแค กรุงเทพมหานคร ประมาณ 1 ชั่วโมงกว่าๆ รถโดยสารฯ ก็ยังไม่มา แต่ผู้ร้องมีอาการอาเจียนหนัก มีอาการปวดหลัง ขายืนไม่ไหว ช่วงเวลาประมาณ 10.00 น. กว่าๆ ผู้ร้องได้ใช้หมายเลขโทรศัพท์ 06 4013 7188 ติดต่อไปศูนย์บริการการแพทย์ฉุกเฉินกรุงเทพมหานคร (ศูนย์เอราวัณ) หมายเลขสายด่วน 1646 ซึ่งเจ้าหน้าที่เพศหญิงรับโทรศัพท์ แจ้งว่า เดี๋ยวคอยสักครู่นะเดี๋ยวจะติดต่อรถในพื้นที่ให้ ซึ่งผู้ร้องแจ้งว่าได้รอรถนานมากแล้วก็ไม่มีรถมารับ ผู้ร้องจึงได้ติดต่อกลับเข้าไปอีกครั้ง เจ้าหน้าที่รับโทรศัพท์แจ้งว่า จะติดต่อรถในพื้นที่ให้ หลังจากนั้นผู้ร้องก็รอ แต่ก็ไม่มีรถมารับ ผู้ร้องจึงติดต่อเข้าไปอีกครั้ง (เป็นครั้งที่ 3) เจ้าหน้าที่รับโทรศัพท์แจ้งว่า ไม่มีรถสักคัน ถ้าจะรอรถมูลนิธิก็อีกประมาณ 1 ชั่วโมง ซึ่งผู้ร้องเห็นว่ามีอาการอาเจียนหนัก และเป็นผู้พิการด้วย จะให้ยืนตากแดด ขาก็ไม่ไหวแล้ว และแจ้งเจ้าหน้าที่ไปแล้วว่า ขายืนไม่ไหวแล้ว ก็ไม่มีรถสักคัน ผู้ร้องได้ติดต่อไปยังสำนักงานหลักประกันสุขภาพแห่งชาติ หมายเลขสายด่วน 1330 เจ้าหน้าที่รับโทรศัพท์แจ้งว่า เพื่อปรึกษาว่าควรทำอย่างไรดี เจ้าหน้าที่พูดว่า คุณพอนั่งแท็กซี่ไปได้ไหม ผู้ร้องตอบไปว่า ไม่ได้ไม่มีเงินค่ารถแท็กซี่สาธารณะ เจ้าหน้าที่จึงแนะนำให้ผู้ร้องติดต่อไปยัง หมายเลขสายด่วน 1669 หลังจากนั้นภายในวันเดียวกันผู้ร้องได้ติดต่อเข้าไปยังหมายเลขสายด่วน 1669 มีเจ้าหน้าที่เพศหญิงรับโทรศัพท์ ผู้ร้องสอบถามว่าที่เดียวกันกับศูนย์เอราวัณหรือเปล่า เจ้าหน้าที่ก็วางสายโทรศัพท์ และหลังจากนั้นภายในวันเดียวกันผู้ร้องได้รับการติดต่อกลับมาแจ้งให้ทราบว่า รถยังไม่มา ซึ่งผู้ร้องแจ้งตอบกลับไปว่า ไม่ต้องแล้ว ไปรถแท็กซี่แล้ว รวมทั้งผู้ร้องทราบข่าวมาว่า เมื่อ 2 วันก่อน มีผู้ป่วยที่พักอาศัยอยู่ภายในซอยเพชรเกษม 90 ได้เรียกรถฉุกเฉิน ก็ไม่มีรถฉุกเฉินมาเหมือนกัน ทางญาติผู้ป่วยได้ให้ผู้ป่วยนั่งรถยนต์บรรทุกส่วนบุคคลไปยังโรงพยาบาล แต่ตอนนี้ผู้ป่วยเสียชีวิตไปแล้ว จากเหตุการณ์ที่เกิดกับผู้ร้องที่รอใช้บริการตั้งแต่เวลาประมาณ 10.000 น. จนเกือบถึงเวลา 12.00 น. ก็ไม่มีรถมารับ จนต้องเดินทางไปโรงพยาบาลด้วยตนเอง และเหตุการณ์ที่เกิดกับผู้ป่วยคนอื่น ผู้ร้องเห็นควรให้ยกเลิกการให้บริการของศูนย์บริการการแพทย์ฉุกเฉินกรุงเทพมหานคร (ศูนย์เอราวัณ) หมายเลขสายด่วน 1646 และหมายเลขสายด่วน 1669 (ที่ผู้ร้องติดต่อเข้าไป) เพราะไม่มีรถรองรับการติดต่อใช้บริการของประชาชน ต้องรอรถในพื้นที่หรือรอรถมูลนิธิ ซึ่งตามปกติแล้วควรที่จะมีรถรองรับการติดต่อใช้บริการของประชาชนตลอดทุกช่วงเวลา โดยไม่ต้องให้ประชาชนรอนาน (บันทึกข้อมูลตามผู้ร้องแจ้ง)(ผู้ร้องยินดีเปิดเผยชื่อ-นามสกุล และหมายเลขโทรศัพท์)
