//อ้างอิงเลขที่รับแจ้ง Traffy Fondue (ZGYJH2)
 ขอให้แก้ไขปัญหาสุนัขสร้างความเดือดร้อนรำคาญ บริเวณบ้านเลขที่.....หมู่บ้านจงสุข ซอยวงศ์สว่าง 19 แขวงบางซื่อ เขตบางซื่อ กรุงเทพมหานคร
บุคคลในหมู่บ้านจงสุข ซอยวงศ์สว่าง 19 ไม่ดูแลสัตว์เลี้ยง โดยปล่อยออกมาก่อความเดือดร้อนรำคาญมาเป็นระยะเวลาไม่น้อยกว่า 5 ปี (เคยมากัดสัตว์ เลี้ยงถึงหน้าบ้านไม่น้อยกว่า 3 ครั้ง) นั้น
//แจ้งข้อมูลเพิ่มเติม// คำร้องจากเว็บไซต์--- (แจ้งข้อมูลเพิ่มเติม) โดยจัดส่งไฟล์วิดีโอ เหตุเกิดวันที่ 9 พฤษภาคม 2566 เวลา 17.10 น. และเหตุเกิดวันที่ 11 พฤษภาคม 2566 เวลา 17.48 น.
ทั้งนี้ ศูนย์ฯ ได้ประสานส่งรายละเอียดเพิ่มเติมตามเอกสารที่แนบทางไปรษณีย์อิเล็กทรอนิกส์     
