ขอความอนุเคราะห์จัดสรรเจ้าหน้าที่ลงพื้นที่ตีเส้นจราจรห้ามจอด (สีขาว-แดง) บริเวณถนนเพชรเกษม 69 แขวงบางแคเหนือ เขตหนองแขม กรุงเทพมหานคร ไปจนถึงหมู่บ้านพงษ์ศิริชัย 2 ตำบลอ้อมน้อย อำเภอกระทุ่มแบน จังหวัดสมุทรสาคร เนื่องจากผู้ร้องแจ้งว่าบริเวณดังกล่าว เป็นถนนที่มีช่องจราจร 4 ช่องจราจร รวมฝั่งขาไป และขากลับ ทั้งหมด 8 ช่องจราจร แต่มักจะมีรถมาจอดกีดขวางช่องทางจราจรตลอดทั้งช่วงเวลากลางวัน และช่วงเวลากลางคืน เป็นประจำทุกวัน โดยผู้ร้องแจ้งว่าในบางช่วงถนน จะมีเส้นจราจรห้ามจอด (สีขาว-แดง) แต่มองเห็นไม่ชัดเจน และในบางช่วงถนนจะไม่มีเส้นจราจรห้ามจอด (สีขาว-แดง) จากการที่มีรถมาจอดกีดขวางช่องทางจราจรนั้น ทำให้ช่องทางจราจรมีพื้นที่แคบลง ซึ่งผู้ร้องเกรงว่าอาจจะก่อให้เกิดอุบัติเหตุได้ โดยประสบปัญหามาเป็นระยะเวลาประมาณ 4-5 ปีแล้ว เบื้องต้นได้แจ้งเรื่องไปยังสำนักงานเขตหนองแขมแล้ว จึงประสงค์ให้หน่วยงานที่เกี่ยวลงพื้นที่ตีเส้นจราจร สีขาว-แดง บริเวณดังกล่าว เพื่อบรรเทาความเดือดร้อนให้แก่ผู้ร้อง และประชาชนท่านอื่นต่อไป (ผู้ร้องประสงค์ให้ปกปิดชื่อ นามสกุล และหมายเลขโทรศัพท์) // (ขอแจ้งเพิ่มเติมข้อมูล 14/05/2566) ผู้ร้องขอแจ้งเพิ่มเติมข้อมูลเกี่ยวกับพื้นที่ที่ประสบปัญหา จากบริเวณแยกเพชรเกษม ถนนพุทธมณฑล สาย 2 (ไม่ระบุแขวงและเขต) กรุงเทพมหานคร ไปจนถึงถนนบรมมราชชนนี (ไม่ระบุแขวงและเขต) กรุงเทพมหานคร (ตามผู้ร้องแจ้ง) และผู้ร้องขอแก้ไขข้อมูลชื่อ-นามสกุลของผู้ติดต่อและผู้เดือดร้อน เบื้องต้นได้ทำการแก้ไขในประวัติผู้ติดต่อและผู้เดือดร้อนเรียบร้อยแล้ว
