ขอให้แก้ไขปัญหาการทิ้งขยะมูลฝอยของประชาชนภายในหมู่บ้านวิสต้าวิลล์ ซอยโพธิ์แก้ว 3 แยก 22 แขวงคลองจั่น เขตบางกะปิ กรุงเทพมหานคร จุดสังเกตอยู่ภายในซอยโพธิ์แก้ว 3 แยก 22 หมู่บ้านดังกล่าวจะอยู่ทางเข้าแยก 22 เนื่องจากผู้ร้องแจ้งว่าประชาชนอาศัยอยู่ภายในดังกล่าวจะมีการนำขยะออกมาทิ้งบริเวณริมกำแพงด้านหน้าของหมู่บ้านฯ ซึ่งจะอยู่ติดกับถนนสาธารณะ โดยผู้ร้องแจ้งว่าบริเวณดังกล่าวไม่ได้เป็นจุดทิ้งขยะและไม่มีถังขยะ ทำให้ขยะที่ประชาชนนำออกมาทิ้งเกลื่อนกลาดเต็มถนนและส่งกลิ่นเหม็นรบกวนเป็นอย่างมาก และทำให้ทัศนียภาพบริเวณดังกล่าวดูไม่สวยงาม ส่งผลให้ประชาชนที่สัญจรผ่านและอาศัยอยู่ในบริเวณใกล้เคียงได้รับความเดือดร้อน ประกอบกับผู้ร้องแจ้งว่าควรให้เจ้าของหมู่บ้านฯ มีการเขียนป้ายห้ามทิ้งขยะบริเวณดังกล่าวด้วย ประสบปัญหามาเป็นระยะเวลาประมาณ 6 เดือน จึงประสงค์ให้หน่วยงานที่เกี่ยวข้องลงพื้นที่ตรวจสอบและแก้ไขปัญหาการทิ้งขยะมูลฝอยของประชาชนในหมู่บ้านดังกล่าว เพื่อบรรเทาความเดือดร้อนให้แก่ประชาชนต่อไป (ผู้ร้องประสงค์ให้ปกปิดชื่อ-นามสกุล และหมายเลขโทรศัพท์)
